import React from "react";

const FriendsList = props => {
  return (
    <div className="friends-list">
      <h2>Friends</h2>
      <div className="name-column">
        <ul>
          <li>Jim</li>
          <li>Chris</li>
        </ul>
      </div>
      <div className="email-column">
        <ul>
          <li>jim@gmail.com</li>
          <li>chris@gmail.com</li>
        </ul>
      </div>
    </div>
  );
};

export default FriendsList;
